script: |
  super -f text -I q11025.spq | sort > q11025.out

inputs:
  - name: q11025.spq
    data: |
      SELECT ALL * FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT + col0 IN ( - + col1, col1 * - - 66, 97 * + col2, + col1 + - - 39, + + CAST ( col1 AS INTEGER ) );
  - name: tab0

outputs:
  - name: q11025.out
    data: |
      15	81	47
      87	21	10
      97	1	99
